-- ----------------------------
--  Table structure for `cfg_Item_original`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_Item_original`;
CREATE TABLE `cfg_Item_original` (
  `id` int(11) NOT NULL COMMENT '子弹id',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '类型，1:子弹，2:医疗包',
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '道具名称',
  `description` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '装备简介，需要在UI里展示该内容',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT 'i+道具的id',
  `modelName` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '模型名字',
  `view` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '展示出来的大图标v+id',
  `weight` float(11,0) NOT NULL DEFAULT '0' COMMENT '重量',
  `capacity` int(11) NOT NULL DEFAULT '1000' COMMENT '上限容量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

