-- ----------------------------
--  Table structure for `cfg_chapter`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_chapter`;
CREATE TABLE `cfg_chapter` (
  `id` int(11) NOT NULL COMMENT '章节id',
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '章节名字',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '章节小图标',
  `view` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '章节展示图',
  `description` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '章节描述',
  `mapScene` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '地图场景名字',
  `beginSection` int(11) NOT NULL DEFAULT '0' COMMENT '章节的开始关卡',
  `endSection` int(11) NOT NULL DEFAULT '0' COMMENT '章节的结束关卡',
  `preID` int(11) NOT NULL DEFAULT '0' COMMENT '前置章节ID',
  `price` int(11) NOT NULL DEFAULT '0' COMMENT '章节价格',
  `unlockStar` int(11) NOT NULL DEFAULT '0' COMMENT '解锁条件：前置关卡的总星数',
  `unlockLevel` int(11) NOT NULL DEFAULT '0' COMMENT '解锁等级',
  `unlockCount` int(11) NOT NULL DEFAULT '0' COMMENT '前置关卡，需要通关的总数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

