-- ----------------------------
--  Table structure for `cfg_enemies`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_enemies`;
CREATE TABLE `cfg_enemies` (
  `id` int(11) NOT NULL COMMENT '怪物id',
  `model` int(11) NOT NULL COMMENT '怪物对应的模型ID, cfg_model',
  `type` int(11) NOT NULL COMMENT '怪物类型，特定武器会对特定类型有伤害加成',
  `level` int(11) NOT NULL,
  `hp` double NOT NULL COMMENT '怪物血量',
  `visionAngle` double NOT NULL COMMENT '视角角度',
  `visionDistance` double NOT NULL COMMENT '视野距离',
  `hearDistance` double NOT NULL COMMENT '听力距离',
  `wanderAngle` double NOT NULL COMMENT '警戒角度',
  `wanderDistance` double NOT NULL COMMENT '警戒距离',
  `attackDistance` double NOT NULL COMMENT '攻击距离',
  `attackAngle` double NOT NULL COMMENT '攻击角度范围',
  `attack` double NOT NULL COMMENT '攻击力',
  `attackRate` double NOT NULL COMMENT '攻击,每秒攻击次数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

