-- ----------------------------
--  Table structure for `cfg_equip`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_equip`;
CREATE TABLE `cfg_equip` (
  `id` int(11) NOT NULL COMMENT '装备ID',
  `originalId` int(11) NOT NULL DEFAULT '0' COMMENT '装备ID，所有同一个把武器，共有的ID',
  `level` int(11) NOT NULL COMMENT '等级',
  `unlockLevel` int(11) NOT NULL COMMENT '解锁等级',
  `attack` double(11,0) NOT NULL COMMENT '攻击力',
  `attackDistance` double NOT NULL COMMENT '武器攻击距离',
  `attackFrequency` double NOT NULL COMMENT '每秒攻击次数',
  `explosionRange` double NOT NULL COMMENT '爆炸范围，以米为单位',
  `bulletClip` int(11) NOT NULL COMMENT '弹夹容量',
  `clipTime` double NOT NULL COMMENT '换弹夹时间',
  `fireSpread` double NOT NULL COMMENT '开火散布度',
  `monsterAffect` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '伤害加成影响怪物类型，格式  type_千分比|type_千分比|type_千分比',
  `upgradeID` int(11) NOT NULL COMMENT '升级之后的下一个ID',
  `updradeExp` int(11) NOT NULL DEFAULT '0' COMMENT '提升所需要的满经验,',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

