-- ----------------------------
--  Table structure for `cfg_equip_original`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_equip_original`;
CREATE TABLE `cfg_equip_original` (
  `id` int(11) NOT NULL COMMENT '对应cfg_equip表中original id',
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '道具名称',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '11.霰弹枪；12.冲锋枪/步枪；13.狙击枪；14.重机枪；15.火箭筒；16.手枪；17.喷火器；18.电磁步枪；19.近战武器\r\n',
  `description` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '装备简介，需要在UI里展示该内容',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT 'i+道具的id',
  `modelName` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '模型名字',
  `view` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '展示出来的大图标v+id',
  `bulletID` int(11) NOT NULL COMMENT '子弹ID',
  `powerRate` float(11,0) NOT NULL DEFAULT '1' COMMENT '升级权重',
  `default_eid` int(11) NOT NULL DEFAULT '0' COMMENT '对应本武器，装备表中的初始装备',
  `clipSize` int(11) NOT NULL DEFAULT '5' COMMENT '弹夹容量',
  `weight` float(11,0) NOT NULL DEFAULT '0' COMMENT '重量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

