INSERT INTO `cfg_equip_original` VALUES ('111', 'S12K', '11', 'S12K霰弹枪', 'i41111101', 'S12K', 'v41111101', '40001', '1', '41111001', '5', '0'), ('112', 'M870', '11', 'M870是一种近距离杀伤性武器，是雷明顿兵工厂于50年代初研制成功的，它一直是美国军、警界的专用装备。', 'i41121101', 'M870', 'v41121101', '40001', '1', '41121001', '5', '0'), ('121', 'MP5', '12', 'MP5冲锋枪获多国的军队、保安部队、警队选择作为制式枪械使用，因此具有极高的知名度', 'i41211101', 'MP5', 'v41211101', '40002', '1', '41211001', '5', '0'), ('122', 'AKM', '12', 'AKM步枪通过改进AK-47突击步枪而来。1959年投产，目前仍有生产。广泛装备世界各地的武装力量。', 'i41221101', 'AKM', 'v41221101', '40002', '1', '41221001', '5', '0'), ('131', 'SKS', '13', 'SKS狙击枪采用普通结构的导气式武器。具有结构简单，刚度好等优点，是一支性能良好的武器。', 'i41311101', 'SKS', 'v41311101', '40003', '1', '41311001', '5', '0'), ('132', 'AWP', '13', 'AWP狙击枪设计粗犷，性能可靠，质量适中，后坐力非常小，是一支高精度的步枪。', 'i41321101', 'AWP', 'v41321101', '40003', '1', '41321001', '5', '0'), ('141', '加特林', '14', '加特林重机枪具有能连发射击，火力猛等优点，但也存在重量大、机动性差等缺点。', 'i41411101', 'Gatling', 'v41411101', '40004', '1', '41411001', '5', '0'), ('151', 'RPG', '15', '苏式火箭筒是一种发射火箭弹的便携式反坦克武器，主要用于近距离打击坦克、装甲车辆 和摧毁工事等目标', 'i41511101', 'RPG', 'v41511101', '40005', '1', '41511001', '5', '0'), ('152', 'M72', '15', 'M72火箭筒是美国赫西东方公司研制的一种美军制式单兵武器，杀伤力巨大', 'i41521101', 'M72', 'v41521101', '40005', '1', '41521001', '5', '0'), ('161', '沙漠之鹰', '16', '沙漠之鹰手枪威力极大世界公认，但同时也存在着枪体重，后坐力大及可靠性低的致命缺点', 'i41611101', 'DesertEagle', 'v41611101', '40006', '1', '41611001', '5', '0'), ('162', '格洛克18C', '16', '格洛克18C手枪射速快，被称为世界上销售数量最大的手枪', 'i41621101', 'G18C', 'v41621101', '40006', '1', '41621001', '5', '0'), ('171', '毁灭者', '17', '毁灭者喷火器', 'i41711101', 'Destoryer', 'v41711101', '40007', '1', '41711001', '5', '0'), ('172', '毁灭者Ⅱ', '17', '毁灭者Ⅱ型喷火器', 'i41721101', 'DestoryerⅡ', 'v41721101', '40007', '1', '41721001', '5', '0'), ('181', '电磁步枪', '18', '电磁步枪', 'i41811101', 'ERifle', 'v41811101', '40008', '1', '41811001', '5', '0'), ('182', '速射电磁步枪', '18', '速射型电磁步枪', 'i41821101', 'ERifleQuick', 'v41821101', '40008', '1', '41821001', '5', '0'), ('191', '唐刀', '19', '唐刀', 'i41911101', 'TangDao', 'v41911101', '0', '1', '41911001', '5', '0'), ('192', '无坚不摧之力', '19', '猪头锤', 'i41921101', 'PigHammer', 'v41921101', '0', '1', '41921001', '5', '0'), ('193', '棒球棍', '19', '棒球棍', 'i41931101', 'BaseBallBat', 'v41931101', '0', '1', '41931001', '5', '0');
COMMIT;

-- ----------------------------
--  Table structure for `cfg_event`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_event`;
CREATE TABLE `cfg_event` (
  `id` int(11) NOT NULL COMMENT '事件ID',
  `type` int(11) NOT NULL COMMENT '事件类型，1:对话框事件, 2:启动节点（如刷怪器，建筑）, 3:击杀怪物，4:特殊事件, 5：延时事件，等待多长时间，启动后续事件',
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '事件名称',
  `description` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '事件描述',
  `time` float NOT NULL COMMENT '事件完成需要的时间, 0表示不限制',
  `nextid` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '下一事件的id|id|id',
  `sectionID` int(11) NOT NULL COMMENT '所属Section ID',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '对话框上的人物图标',
  `nodeName` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '启动节点的名称/特殊事件节点名称',
  `killEnemies` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '需要击杀的挂物 id_数量|id_数量。 当id为0时，表示所有怪物都算',
  `star` int(11) NOT NULL DEFAULT '0' COMMENT '完成此事件，给关卡评价增加的星级',
  `mainLine` int(11) NOT NULL DEFAULT '0' COMMENT '主线任务，失败即游戏结束的事件，1:为主线，0:为非主线',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

-- ----------------------------
--  Records of `cfg_event`
