-- ----------------------------
--  Table structure for `cfg_mission`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_mission`;
CREATE TABLE `cfg_mission` (
  `id` int(11) NOT NULL COMMENT '任务ID',
  `type` int(11) NOT NULL COMMENT '事件类型，1:对话框事件, 2:点击某个按钮, 3:使用物品，4:进入某个关卡，5:完成某个关卡，6:击杀敌人',
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '时间名称',
  `description` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '事件描述',
  `nextID` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '下一事件的id|id|id',
  `nodeName` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '事件绑定节点的名字',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '对话框上的人物图标',
  `propToUse` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '需要使用的物品id|id|id',
  `count` int(11) NOT NULL DEFAULT '1' COMMENT '需要完成的数量, 操作型需要完成数量填写0',
  `sectionID` int(11) NOT NULL DEFAULT '0' COMMENT '与关卡相关时，设置关卡对应的ID',
  `restartID` int(11) NOT NULL COMMENT '当前事件，退出游戏时，重置到事件',
  `killEnemy` int(11) NOT NULL DEFAULT '0' COMMENT '击杀的敌人ID',
  `boxID` varchar(11) COLLATE utf8mb4_bin NOT NULL DEFAULT '0' COMMENT '给的箱子ID|ID|ID|ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

-- ----------------------------
--  Records of `cfg_mission`
-- ----------------------------
