INSERT INTO `cfg_mission` VALUES ('101', '1', '', '（旁白）救援艾拉等幸存者的直升机受到了未知的攻击，飞机被迫紧急降落。', '102', '', '', '', '0', '0', '101', '0', '500101'), ('102', '1', '', '（旁白）然而落地后却突如其来地受到怪物攻击，作为救援者之一的我和他们走散了。', '103', '', '', '', '0', '0', '101', '0', '500102'), ('103', '1', '', '这个破房子貌似还能落脚，我稍微休整一下，然后赶紧找到他们', '104', '', 'i100001', '', '0', '0', '101', '0', '500101'), ('104', '1', '', '我得赶紧到附近的镇子上找一下它们，要不然的话对谁来说都太危险了。', '105', '', 'i100001', '', '0', '0', '101', '0', '500103'), ('105', '1', '', '希望他们还没出什么事吧，我先过去探一下路吧', '106|107', '', 'i100001', '', '0', '0', '101', '0', '501001'), ('106', '5', '清理', '到附近小城镇的诊所中探路，并根据关卡内指引完成关卡', '152', '', '', '', '0', '701020', '0', '0', '501002'), ('107', '1', '', '点击任务按钮，查看任务目标', '108', '', '', '', '0', '0', '107', '0', ''), ('108', '2', '', '', '109', 'UIHomeBtnTask', '', '', '0', '0', '107', '0', ''), ('109', '1', '', '任务分为主线任务及支线任务，同时在此界面中可查看详细的任务目标及奖励', '110', '', '', '', '0', '0', '107', '0', ''), ('110', '2', '', '', '111', 'UITaskBtnClose', '', '', '0', '0', '107', '0', ''), ('111', '1', '', '是时候要出门了，点击界面上的战斗按钮进入章节选择界面', '112', '', '', '', '0', '0', '111', '0', ''), ('112', '2', '', '', '113', 'UIHomeBtnMap', '', '', '0', '0', '111', '0', ''), ('113', '1', '', '点击当前正在攻略的第一章节', '114', '', '', '', '0', '0', '111', '0', ''), ('114', '2', '', '', '115', 'Chapter701000', '', '', '0', '0', '111', '0', ''), ('115', '1', '', '点击第一关《XXXXX》', '116', '', '', '', '0', '0', '111', '0', ''), ('116', '2', '', '', '117', 'Section701020', '', '', '0', '0', '111', '0', ''), ('117', '1', '', '此处会显示关卡的详细信息，点击“挑战”按钮进入关卡', '118', '', '', '', '0', '0', '111', '0', ''), ('118', '2', '', '', '119', 'UIChallengeSectionBtnChallenge', '', '', '0', '0', '111', '0', ''), ('119', '1', '', '战斗胜利时会获得一定的物资道具，点击“确定”按钮退出当前关卡', '120', '', '', '', '0', '0', '111', '0', ''), ('120', '2', '', '', '121', 'SuccessBtnBackMap', '', '', '0', '0', '0', '0', ''), ('121', '1', '', '点击返回按钮', '122', '', '', '', '0', '0', '0', '0', ''), ('122', '2', '', '', '123', 'UISectionBtnClose', 