-- ----------------------------
--  Table structure for `cfg_prop`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_prop`;
CREATE TABLE `cfg_prop` (
  `id` int(11) NOT NULL COMMENT '道具id',
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '道具名字',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '类型：1经验书， 2武器书',
  `description` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '道具描述',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '道具图标i+id',
  `originalId` int(11) NOT NULL DEFAULT '0' COMMENT '原始ID：经验书填写经验书统一I',
  `star` int(11) NOT NULL DEFAULT '0' COMMENT '武器星级',
  `exp` int(11) NOT NULL DEFAULT '0' COMMENT '经验值',
  `decompose` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '分解成的材料:prop表 id_count|id_count',
  `eid` int(11) NOT NULL DEFAULT '0' COMMENT '对应的武器表id',
  `power` int(11) NOT NULL DEFAULT '0' COMMENT '升星提供的power',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

