DROP TABLE IF EXISTS `cfg_role`;
CREATE TABLE `cfg_role` (
  `id` int(11) NOT NULL COMMENT '角色表ID',
  `sex` int(11) NOT NULL COMMENT '性别, 1:男，2:女',
  `model` int(11) NOT NULL DEFAULT '0' COMMENT '对于cfg_model里面的id',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '角色头像',
