-- ----------------------------
--  Table structure for `cfg_section`
-- ----------------------------
DROP TABLE IF EXISTS `cfg_section`;
CREATE TABLE `cfg_section` (
  `id` int(11) NOT NULL COMMENT 'section ID',
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '名称',
  `icon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '图标',
  `iconHighlight` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '高亮图标',
  `view` varchar(255) COLLATE utf8mb4_bin NOT NULL,
  `description` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '描述',
  `tips` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '打开小节界面之后的提示文字',
  `dropTips` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '掉落提示',
  `dropIcon` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '小节提示，在icon图标上方显示',
  `level` int(11) NOT NULL COMMENT '关卡困难等级：1简单，2普通，3困难，4危险，5极度危险',
  `sceneName` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '进入的场景文件',
  `touchTips` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '触摸提示',
  `exploreProgress` double NOT NULL COMMENT '章节探索进度，打开所占的百分比',
  `finishProgress` double NOT NULL COMMENT '章节完成度，完成所占的百分比',
  `chapterID` int(11) NOT NULL COMMENT '所属章节ID',
  `preID` int(11) NOT NULL COMMENT '前一个关口ID',
  `unlockStar` int(11) NOT NULL COMMENT '解锁星级',
  `unlockLevel` int(11) NOT NULL COMMENT '解锁等级',
  `exp` int(11) NOT NULL DEFAULT '0' COMMENT '玩家获取的经验',
  `eventid` int(11) NOT NULL DEFAULT '0' COMMENT '开始事件ID',
  `boxid` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '箱子的id，随机获得1个 id|id|id',
  `gold` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '获得的金币 1000|2000 ，随机奖励1000到2000之间的数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

