-- ----------------------------
DROP TABLE IF EXISTS `cfg_shop`;
CREATE TABLE `cfg_shop` (
  `id` int(11) NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '商品名字',
  `items` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '出售的物品 类型_id_数量|类型_id_数量|类型_id_数量| 类型:1道具(道具表查询)，2配件(配件表查询)，3武器(武器表查询), 4钻石，5金币',
  `gold` int(11) NOT NULL COMMENT '金币价格',
  `diamond` int(11) NOT NULL COMMENT '钻石价格',
  `buyTimes` int(11) NOT NULL COMMENT '购买次数',
  `discount` int(11) NOT NULL COMMENT '折扣，7.5折 填写75',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

